import React from "react";

import { nblogo } from "../index.js";

import "./styles.css";

const ImgIntro = () => {
  return (
    <div className="img-container">
      <img
        src="https://img.modivo.cloud/product(9/2/6/b/926b76ccf2a4888a9261bc36570dec672931fde8_01_0000301902560_rz.jpg,webp)/new-balance-snikerci-pv574nd1-cinii.webp"
        alt="Avatar"
        className="image"
      />
      <div className="middle">
        <img alt="logo" className="logo" src={nblogo} />
      </div>
    </div>
  );
};

export default ImgIntro;
